import React from "react";

function All() {
  return (
    <div className="relative z-2 w-full flex p-5 justify-between">
      {/* All header */}
      <div className="flex">
        <span className="font-bold">전체메일</span>{" "}
        <span className="text-[#0173E5]">0</span>
        <span className="text-[#767678]"> / 163</span>
      </div>
      <div className="w-[240px] h-[30px] p-2 rounded-[15px] flex items-center bg-[#F0F1F6]">
        <input className="bg-[#F0F1F6] text-[14px]" placeholder="메일검색" />
      </div>
    </div>
  );
}

export default All;
